class Solution {

    /**
     * @param String $num1
     * @param String $num2
     * @param Integer $min_sum
     * @param Integer $max_sum
     * @return Integer
     */
    function count($num1, $num2, $min_sum, $max_sum) {
        $MOD = 1000000007;

        $count = 0;
        for ($i = max(1, (int)$num1); $i <= (int)$num2; $i++) {
            $sum = $this->digitSum($i);
            if ($sum >= $min_sum && $sum <= $max_sum) {
                $count = ($count + 1) % $MOD;
            }
        }
        return $count;
    }

    private function digitSum($n) {
        $sum = 0;
        while ($n > 0) {
            $sum += $n % 10;
            $n = intdiv($n, 10);
        }
        return $sum;
    }
}
